description:
D-Day: The Last Heroes

War Documentary hosted by Dan Snow, published by BBC in 2013 - English narration


Information
------------------------------

Historian Dan Snow examines how two years of meticulous planning, espionage and the analysis of millions of three-dimensional aerial photographs helped the Allied Forces gain a foothold in northern France.

